shared FilterRowsbyColumn = let
    // This function filters a table (Entity) by the first
    // N rows pass FilterValue to set number of rows to
    // return
    // :returns: Table
    FilterColumn = (Entity as table, FilterValue as text, ColumnName as text) => let
    CleanFilterValue = List.Transform(List.Transform(Text.Split(FilterValue, ","), Text.Trim), Text.Upper),
    Filter = if List.AnyTrue({
    not List.Contains(Table.ColumnNames(Entity), ColumnName),
    FilterValue = ""
    })
    then Entity
    else
    try{
    // returns a list with first entry an Entity (table)
    Table.SelectRows(Entity, each List.Contains(List.Buffer(CleanFilterValue), Text.Upper(Record.Field(_, ColumnName))))
    } otherwise {
    Entity
    },
    // checks if Filter returned a list if so gets the filtered Entity from
    // the first entry in the list otherwise returns the original Entity
    Result = if Value.Is(Filter, List.Type) then Filter{0} else Filter
in
    Result
in
    FilterColumn;

